INSERT INTO `actividades` (`id`, `date_time`, `titulo`, `descripcion`, `fecha_ini`, `fecha_fin`, `horas`, `documentacion`, `gestor`, `horario`, `lugar`, `plazas`, `plazo_inscripcion`, `inscripcion`, `gestion`, `modalidad`, `codigo_solicitud`, `codigo_ice`, `formador`, `financiacion`, `contacto`, `impartido`, `bloque`, `observaciones`) VALUES
	(1, '2017-09-12 11:05:06', 'EMBO Workshop in Research Integrity', '<p>In the last few years the European Molecular Biology Organization (EMBO) has been increasingly involved in providing scientists with the parameters of the responsible conduct of research. We have organized a one-day workshop, in which EMBO will discuss with the participants issues such as research integrity in the writing and publication of research results, the roles of scientists in society, data management, the responsibilities of supervisors, conflicts of interests and research involving animals. The workshop will include practical scenarios and examples and it is open to PhD students, postdocs and principal investigators, who are active in research.</p>\r\n<p>Participation is free of charge, but registration is required.</p>\r\n<p>The EMBO officers also offer to meet senior staff members (senior PIs, heads of depts. and/or of institutes) in informal small meetings to discuss issues related to research integrity. These meetings will be held on Friday 27th October in the morning and can be arranged in advance by e-mailing David Cánovas at <a href="mailto:davidc@us.es">davidc@us.es</a>.</p>\r\n<p>Maximum number of participants: 30</p>\r\n<div class="alert-error alert">Registration closed. Maximum number of participants exceeded. Selection of participants will be undertaken</div>', '2017-10-26 00:00:00', '2017-10-26 00:00:00', 8.00, NULL, 6, '9.00 a 17.00 h', 'Salón de Actos del Pabellón de México', 30, 'cerrado', '', 'EIDUS', 'presencial', '', '', '', 'EIDUS', '', 1, '', ''),
	(3, '2017-10-02 10:33:21', 'Jornada informativa sobre Doctorado Industrial', '<p>El día <strong>18 de octubre a las 17h</strong> en el Salón de Actos del Pabellón de México, la EIDUS organizará una jornada sobre&nbsp;<strong>Doctorado Industrial.&nbsp; </strong>No se trata sólo de la colaboración con empresas, sino también con administraciones públicas, por lo que también pueden participar los alumnos de humanidades.</p>\r\n<p>En el acto, impartirá una conferencia sobre Doctorado Industrial la Dra Olga Martín Directora de la Escuela de Doctorado de Lérida, experta en la materia y Presidenta de la Conferencia de Directores de Escuelas de Doctorado de España. Posteriormente habrá una mesa redonda a la que han confirmado su asistencia los vicerrectores de Investigación y de Internacionalización de la US, así como el Director General de Transferencia del Conocimiento de la US, la Directora General de Universidades, y el Director General de Investigación y Transferencia del Conocimiento de la Junta de Andalucía, la Presidenta del Consejo Social de la US, y el Director General de Corporación Tecnológica de Andalucía (CTA)</p>\r\n<p>Creemos que es una gran oportunidad para conocer y potenciar esta mención del doctorado que acerca la universidad a la empresa e instituciones públicas, y en definitiva a la sociedad.</p>\r\n<p>En la Jornada se explicarán los procedimientos para obtenerlo y las becas y ayudas ofertadas por los distintos organismos estatales y locales a las que podemos optar.</p>\r\n<p>A los alumnos asistentes se les emitirá, si así lo desean, un certificado de participación que podrá servirles como parte de la formación transversal. Habrá para ello una hoja de firmas en el salón de actos.<br /><br /></p>\r\n<p>Anexo:</p>\r\n<p>Artículo 15 del Real Decreto 195/2016 (<a>https://www.boe.es/buscar/</a><wbr /><a>doc.php?id=BOE-A-2016-5339</a>) en el que se establecen los requisitos para la expedición del Suplemento Europeo al Título Universitario de Doctor:</p>\r\n<p><em>«Artículo 15 bis. Mención Industrial en el título de Doctor.</em><br /><em>1. Se otorgará la mención “Doctorado Industrial” siempre que concurran las siguientes circunstancias:</em><br /><em>a) La existencia de un contrato laboral o mercantil con el doctorando. El contrato se podrá celebrar por una&nbsp;<strong>empresa del sector privado o del sector público, así como por una Administración Pública.</strong></em><br /><em>b) El doctorando deberá participar en un proyecto de investigación industrial o de desarrollo experimental que se desarrolle en la empresa o Administración Pública en la que se preste el servicio, que no podrá ser una Universidad. El proyecto de investigación industrial o de desarrollo experimental en el que participe el doctorando tiene que tener relación directa con la tesis que realiza. Esta relación directa se acreditará mediante una memoria que tendrá que ser visada por la Universidad.</em><br /><em>2. En el caso de que el proyecto de investigación industrial o de desarrollo experimental se ejecute en colaboración entre la Universidad y la empresa o Administración Pública en la que preste servicio el doctorando, se suscribirá un convenio de colaboración marco con entre las partes. En este convenio se indicarán las obligaciones de la Universidad y las obligaciones de la empresa o Administración Pública, así como el procedimiento de selección de los doctorandos.</em><br /><em>El doctorando tendrá un tutor de tesis designado por la Universidad y un responsable designado por la empresa o Administración Pública, que podrá ser, en su caso, Director de la tesis de acuerdo con la normativa propia de Doctorado.»</em></p>', '2017-10-18 00:00:00', '2017-10-18 00:00:00', 2.50, NULL, 6, '17:00 - 19:30', 'Salón de Actos del Pabellón de México', 120, 'cerrado', '', 'EIDUS', 'presencial', '', '', '', 'EIDUS', '', 1, '', ''),
	(4, '2017-10-30 09:37:17', 'Taller sobre dirección de Tesis Doctorales', '<p>El objetivo fundamental del taller es crear un foro de discusión sobre los aspectos más relevantes del trabajo del director de tesis, de tal forma que se obtengan las claves para conseguir una supervisión de calidad. Entre otros, se analizarán diferentes aspectos relacionados con los siguientes temas:</p>\r\n<ul>\r\n<li>Claves de los programas RD 99/2011.</li>\r\n<li>Código de buenas prácticas para la dirección de tesis doctorales.</li>\r\n<li>Problemas frecuentes que suelen aparecer en el proceso de dirección.</li>\r\n<li>La conducta responsable en la investigación.</li>\r\n<li>El seguimiento del doctorando.</li>\r\n<li>Estrategias para corregir y proporcionar <em>feedback</em>.</li>\r\n<li>Mínimos exigibles para la presentación de la tesis.</li>\r\n<li>La codirección.</li>\r\n</ul>', '2017-11-24 00:00:00', '2017-11-24 00:00:00', 4.00, NULL, 6, '9:00h - 13:00h', 'Salón de actos Pabellón de México ', 30, 'cerrado', '', 'EIDUS', 'presencial', '', '', '', 'EIDUS', '', 1, '', ''),
	(5, '2017-11-07 08:40:38', 'Actividad ficticia', '<p>Curso de prueba</p>', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0.00, NULL, 6, '20', 'Pabellon de MExico', 26, 'abierto', '', 'EIDUS', 'presencial', '', '', 'Ezequiel Ardila', 'EIDUS', '', 0, '', '');
