	(6, '2017-09-20 13:45:57', 'Juan José ', 'Toledo Aral', '["PhD student","PI"]', 'juanjo@us.es', 'Facultad de Medicina/IBiS', 'Fisiología Médica y Biofísica', 'CTS-517', 'Director de Departamento, Coordinador de Área en IBiS y miembro de la Comisión de Investigación. Trata con temas de ética científica.', 'Humanos y roedores.', 1, NULL, NULL, NULL, NULL, NULL),
	(5, '2017-09-20 13:16:46', 'Alberto', 'Pascual Bravo', '["PI"]', 'apascual-ibis@us.es', 'Hospital Universitario Virgen del Rocío/CSIC/Universidad de Sevilla', 'Instituto de Biomedicina de Sevilla (IBiS)', 'Mechanisms of neuronal maintenance', 'To learn about the responsibilities that we have as PIs regarding ethics in Science and how to establish good practices in the lab.', 'Drosophila and Mouse', 1, NULL, NULL, NULL, NULL, NULL),
	(7, '2017-09-21 10:07:04', 'Yolanda María', 'Pacheco López', '["PI"]', 'ypacheco-ibi@us.es', 'Hospital Universitario Virgen del Rocío', 'Instituto de Biomedicina de Sevilla', 'Laboratorio de Inmunovirología', 'El tema me parece de gran interés', 'Muestras de sangre y de tejido humanos \r\nCultivos celulares primarios (humanos)', 1, NULL, NULL, NULL, NULL, NULL),
	(8, '2017-09-21 13:58:38', 'Sonia ', 'Pinela da Silva', '["Postdoc"]', 'sonia.pinela@cabimer.es', 'CABIMER', 'Genome Biology', 'Andres Aguilera', 'As a postdoc researcher, it is essential to be active and updated in the field of Research Integrity. The discussion of the major challenges and conduct in the field of scientific research nowadays are central to our work and to be able to produce significant and reliable data and publications, stimulate meaningful and positive scientific and social discussion. Theses are, in my view, imperative if we want to produce knowledge and be able to sustain research as an essential tool of progress in all fields being it environment, health, finance, socio-cultural. etc. ', 'Human tumoral cell lines, yeast, bacteria', 1, NULL, NULL, NULL, NULL, NULL),
	(9, '2017-09-21 16:46:59', 'LUCIA', 'ROMERO AZOGIL', '["PhD student"]', 'lrazogil@us.es', 'FACULTAD DE FARMACIA', 'QUIMICA ORGANICA Y FARMACEUTICA', 'CARBOHIDRATOS Y POLIMEROS', '', 'UNIVERSIDAD DE SEVILLA', 1, NULL, NULL, NULL, NULL, NULL),
	(10, '2017-09-21 16:54:25', 'Anabell ', 'Urbina Salazar ', '["PhD student"]', 'gata-any@hotmail.com', 'Facultad de Farmacia ', 'Bioquímica y Biología Molecular ', 'AGR-0258', 'Aprender todo lo relacionado con la investigación. ', 'Bacillus licheniformis', 1, NULL, NULL, NULL, NULL, NULL),
	(11, '2017-09-21 16:59:56', 'Alberto Renato ', 'Inca Torres ', '["PhD student"]', 'creny_11@hotmail.com', 'Facultad de Farmacia ', 'Bioquimica y Biología Molecular ', 'AGR - 0258', 'Incrementar mis conocimientos en todo el área investigativa ', 'Bacillus licheniformis ', 1, NULL, NULL, NULL, NULL, NULL),
	(12, '2017-09-22 07:54:12', 'XI', 'DANG', '["PhD student"]', 'dancer0906@gmail.com', 'Universo de Sevilla (Hospital Virgen del Rocío, IBIS)', 'Cirugía ', 'Análisis observacional para evaluar la eficacia y seguridad de los mTORi en la esfera oncológica en el paciente trasplantado hepaático', '', 'Research involving animals.', 1, NULL, NULL, NULL, NULL, NULL),
	(13, '2017-09-22 08:02:42', 'Emilia', 'Naranjo Fernández', '["PhD student"]', 'eminaranjo@us.es', 'Facultad de Farmacia', 'Microbiología y Parasitología', 'BIO320 Biostabilizadores de Origen Microbiano. Joaquín J. Nieto', 'Este curso me completa mis estudios de doctorado', 'Bacterias', 1, NULL, NULL, NULL, NULL, NULL),
	(14, '2017-09-22 08:02:05', 'Rosa María', 'García Valero', '["PhD student"]', 'rgarcia5@us.es', 'Universidad de Sevilla', 'Microbiología y Parasitología', 'Grupo PAIDI: BIO320 (Joaquín Nieto)', 'Creo que este curso encaja por completo en mi formación como doctoranda.', 'Bacterias, cultivos celulares y roedores.', 1, NULL, NULL, NULL, NULL, NULL),
	(15, '2017-09-22 08:02:25', 'Lourdes', 'Martinez', '["PhD student"]', 'loumarmar91@gmail.com', 'Facultad de Farmacia. Universidad de Sevilla', 'Microbiología y Parasitología', 'BIO320 (Joaquín J. Nieto Gutiérrez)', 'Este curso me dotará nuevos conocimientos para la realización de mi doctorado y competencias para el ámbito investigador.', 'Bacteria.', 1, NULL, NULL, NULL, NULL, NULL),
	(16, '2017-09-22 08:09:38', 'Cristina', 'Sanchez-Porro', '["PhD student","PI"]', 'sanpor@us.es', 'Facultad de Farmacia', 'Microbiología y Parasitología', 'Microorganismos halófilos (BIO213)', '', 'Environmental microorganisms', 1, NULL, NULL, NULL, NULL, NULL),
	(17, '2017-09-22 08:18:24', 'Christian', 'Rosales Barrios', '["PhD student"]', 'christianrosalesbarrios@gmail.com', 'Instituto de Investigaciones Químicas (cicCartuja)', 'Química Orgánica y Biológica', 'Síntesis asimétrica y nanosistemas funcionales', '', 'CSIC, CABIMER, IBIS', 1, NULL, NULL, NULL, NULL, NULL),
	(18, '2017-09-22 08:17:27', 'Elena', 'Romero Ben', '["PhD student"]', 'eleromben@gmail.com', 'Instituto de Investigaciones Química Isla de la Cartuja. CSIC', 'Química Orgánica y Biológica', 'Síntesis asimétrica y Nanosistemas Funcionales', '', 'Consejo Superior de Investigaciones Científicas', 1, NULL, NULL, NULL, NULL, NULL),
	(19, '2017-09-22 08:30:20', 'Rocío', 'Martínez de Pablos', '["PhD student","PI"]', 'depablos@us.es', 'Facultad de Farmacia', 'Bioquímica y Biología Molecular', 'Bio113 (José Luis Venero y Rocío Martínez)', 'Me gustaría trasladar al resto del grupo la información recibida en el workshop, ya que trabajamos con muchos animales con procedimientos a veces moderados/severos', 'Mice and rats', 1, NULL, NULL, NULL, NULL, NULL),
	(20, '2017-09-22 08:33:53', 'DIEGO', 'RUANO CABALLERO', '["PI"]', 'ruano@us.es', 'Instituto de Biomedicina de Sevilla', 'Bioquímica y Biología Molecular', 'Diego Ruano', '', 'Rat', 1, NULL, NULL, NULL, NULL, NULL),
	(21, '2017-09-22 09:14:54', 'María', 'Ortego Domínguez', '["PhD student"]', 'modguez_92@hotmail.com', 'Facultad de Medicina', 'Fisiología Médica y Biofísica', 'Biofísica Celular', 'Interés por conocer más acerca de los límites éticos de la investigación (ya sea en humanos como en animales), así como la metodología y organismos encargados de dicha ética. ', 'Rata (cepa Wistar, Rattus norvergicus)', 1, NULL, NULL, NULL, NULL, NULL),
	(22, '2017-09-22 09:27:33', 'Clara', 'Muñoz Castro', '["PhD student"]', 'claramc19@gmail.com', ' Facultad de Farmacia.', 'Departamento de Bioquímica y Biología Molecular.', 'Javier Vitorica', 'Considero la Ética un aspecto esencial en nuestras vidas, y por lo tanto, debe considerarse en toda investigación científica. Teniendo en cuenta la existencia de diversos dilemas éticos en el ámbito de las ciencias, asistir a un workshop sobre este tema puede ser de gran utilidad en el día a día de cualquier investigador y contribuir, en consecuencia, a una adecuada formación de los doctorandos.\r\n', 'Universidad de Sevilla. \r\nInsituto de Biomedicina de Sevilla (IBiS).', 1, NULL, NULL, NULL, NULL, NULL),
	(23, '2017-09-22 08:37:34', 'María Pilar', 'Puerto Camacho', '["PhD student"]', 'mpilarpuertocamacho@gmail.com', 'Instituto de Biomedicina de Sevilla (IBiS)', 'Oncohematology and Genetic Area', 'Molecular Pathology of Sarcoma and other ', 'Currently, scientific misconduct is appearing more freqquently than expected in the news. This scary situation must be struggled by ethical education to the scientific community. As a second-year PhD student, attending this workshop would be of great value.for my oersonal scientific career ', 'Human tumour cell lines and mice', 1, NULL, NULL, NULL, NULL, NULL),
	(24, '2017-09-22 09:27:03', 'MARIA VIRTUDES', 'SANCHEZ MICO', '["PhD student"]', 'marsanmic@gmail.com', 'Facultad de Farmacia', 'Departamento de Bioquímica y Biología Molecular', 'Javier Vitorica', 'La asistencia a este workshop sería muy útil en mi carrera investigadora, debido a la carencia de este tipo de cursos y enseñanzas, en general. Hoy en día, es muy importante que los investigadores tengan buenas conductas en la investigación, y conozcan los límites éticos y las buenas prácticas necesarias a la hora de trabajar en un laboratorio de investigación, y esta enseñanza no se nos ha transmitido a los doctorandos en ningún momento en nuestra educación hasta ahora, con lo que considero que esta es la mejor oportunidad, pudiendo aprender de investigadores y especialistas con gran experiencia en este aspecto. ', 'Universidad de Sevilla\r\nInstituto de Biomedicina de Sevilla (IBiS)', 1, NULL, NULL, NULL, NULL, NULL),
	(25, '2017-09-22 09:16:02', 'MARÍA DEL CARMEN', 'NARANJO GUTIÉRREZ', '["PhD student"]', 'cnaranjo@us.es', 'Facultad de Medicina / Instituto de Biomedicina de Sevilla-IBIS', 'Bioquímica Médica y Biología Molecular e Inmunología', 'Neuroendocrinología Molecular (PAI-CTS 0160) ', 'Los temas que se tratarán en esta jornada redundan directamente en mi formación como investigadora, ampliando y actualizando mis conocimientos sobre la ética y las buenas prácticas en la investigación.', 'Ratas, ratones y humanos', 1, NULL, NULL, NULL, NULL, NULL),
	(26, '2017-09-22 09:35:02', 'Helena', 'Domínguez Martín', '["PhD student"]', 'hdominguez-ibis@us.es', 'Facultad de Farmacia', 'Bioquímica y Biología Molecular', 'Javier Vitorica', 'Al estar trabajando en investigación científica aplicada a la biomedicina, con modelos animales en rata y ratón, creo que es de suma importancia tener claros los límites y valores éticos y morales en los cuales debemos basarnos a la hora de tomar ciertas decisiones.\r\nEs algo que, si se trata durante la formación universitaria, suele ser someramente, y es de esperar que el estudiante tenga ya una integridad moral de base; pero al enfrentarte al día a día de la investigación con animales se echan en falta ciertas pautas y consejos que deben continuar recordándose a lo largo de la carrera investigadora.\r\nEs por ello que me resulta de sumo interés este curso, el cual considero necesario e indispensable para todo aquel que trabaje en este tipo de campos.', 'Cultivos celulares, rata (Rattus norvergicus) y ratón (Mus musculus).', 1, NULL, NULL, NULL, NULL, NULL),
	(27, '2017-09-22 09:56:57', 'Helena', 'García Moreno', '["PhD student"]', 'helgarmor@alum.us.es', 'Facultad de Medicina ', 'Bioquimica Médica y Biología Molecular e Inmunología ', 'Neuroendocrinología Molecular (PAI-CTS 0160)', 'Creo que la ética en todos los ámbitos de la vida es importante y mucho más si hablamos de investigación. Puesto que los trabajos de investigación suelen estar cercanos a los límites de la ética así como estar más adelantados a las corrientes de pensamientos de la sociedad, es por ello interesante conocer esta materia con toda la profundidad posible. ', 'Cultivos celulares de mastocitos RBL-2H3.', 1, NULL, NULL, NULL, NULL, NULL),
	(28, '2017-09-22 10:12:04', 'Ana', 'Durán Viseras', '["PhD student"]', 'anaduran@us.es', 'Facultad de Farmacia', 'Microbiología y Parasitología', 'Microorganismos Halófilos', '', 'Microorganismos', 1, NULL, NULL, NULL, NULL, NULL),
	(29, '2017-09-22 10:20:40', 'OLGA', 'RODRÍGUEZ-GALÁN ', '["PhD student","Postdoc"]', 'olgarg@us.es', 'INSTITUTO DE BIOMEDICINA DE SEVILLA', 'GENETICA', 'JESÚS DE LA CRUZ DÍAZ', 'ENCUENTRO ESTAS JORNADAS SOBRE ÉTICA EN INVESTIGACIÓN MUY INTERESANTES Y ÚTILES. CONSIDERO QUE LA COMUNIDAD CIENTÍFICA TENEMOS UNA RESPONSABILIDAD CON LA SOCIEDAD EN CUANTO A LA VERACIDAD, TRANSPARENCIA Y DIVULGACIÓN DE LOS RESULTADOS QUE OBTENEMOS EN NUESTRA INVESTIGACIÓN, ASÍ COMO DEL USO QUE HACEMOS DE LOS RECURSOS QUE DICHA SOCIEDAD NOS FACILITA.\r\nPOR TANTO, LA FORMACIÓN DE LOS INVESTIGADORES EN ÉTICA ES ESENCIAL.', 'LEVADURAS', 1, NULL, NULL, NULL, NULL, NULL),
	(30, '2017-09-22 08:57:37', 'Pablo', 'del Cerro Sánchez', '["PhD student"]', 'pdelcerro@us.es', 'Facultad de Biología - Universidad de Sevilla', 'Microbiología', 'Francisco Javier Ollero Márquez (Biotecnologia de la Interacción Planta-Microorganismo Beneficiosos)', 'Me parece interesante la temática del curso. En la investigación se presiona mucho a los grupos por publicar y en algunos casos, se consigue que estas personas no cumplan con los requerimientos éticos y experimentales que conlleva la investigación.', 'Sinorhizobium/Rhizobium (Bacteria)\r\nEscherichia coli (Bacteria)\r\nPhaseolus vulgaris (Leguminous plant)\r\nLotus (Leguminous plant)', 1, NULL, NULL, NULL, NULL, NULL),
